        { name: 'NexusUploaderShow.pptx', value: "Unknown" },
        { name: 'NexusUploaderShow.pptx', value: "Unknown" },
    ];

    return(
        <Container style={{ padding: '10%'}}>
            <Row className="justify-content-md-center">
                <Col>
                {/* <Table striped bordered hover responsive>
                    <thead style={{ "background-color": "#424242", "color": "white", "margin": "center" }}>
                        <tr>
                            <th>Packages Status</th>
                        </tr>
                    </thead>
                    <ListGroup variant="light">
                        {data.map((item) => 
                            <ListGroup.Item> {item.name}:   {item.value} </ListGroup.Item>
                        )}
                    </ListGroup>
                </Table> */}
                <Form>
                    <Form.Group>
                        <Form.Label>Example multiple select</Form.Label>
                        <Form.Control as="textarea" multiple>
                            {data.map((item) =>
                                <option> {item.name}:   {item.value} </option>
                            )}
                        </Form.Control>
                    </Form.Group>
                </Form>
                </Col>
            </Row>
        </Container>
    );
}

export default StatusCard;
